import React, { Component } from 'react';
import {Navbar,Nav,Container} from 'react-bootstrap';

export default class NavBarComp extends Component {
    render(){
        return(
            <div>
                <Navbar bg="dark" variant="dark">
                    <Container>
                        <Navbar.Brand href="#">Logo</Navbar.Brand>
                        <Nav className="me-auto">
                            <Nav.Link href="/Home.js">Home</Nav.Link>
                            <Nav.Link href="/medias.js">Medias</Nav.Link>
                            <Nav.Link href="/lentes.js">Lentes</Nav.Link>
                            <Nav.Link href="/contactanos.js">Contactanos</Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
            </div>
        )
    }
}

let array=[60,50,10,20,120,34]; // :)
let mayor= array[0];

for(i=0; i>=7; i++){
  if(array[0]>=array[i]){
    let remplanzar=array[0];
    array[0]=array[i];
    array[i]=remplazar;
  }
}
console.log(...array);
